import React from 'react';
import './About.css';

const About = () => {
  return (
    <div className="about-container">
      <h1>O mnie</h1>
      <p>Witaj! Nazywam się Jan Kowalski i jestem pasjonatem tworzenia aplikacji webowych.</p>
      {/* Pozostała zawartość */}
    </div>
  );
};

export default About;
